  "inlineSchema": "// Loyalty Platform - Prisma Schema\n// Aligned with Loyalty_Platform_Feature_Summary_EN_with_NFR.md\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"sqlite\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// Seed: npm run prisma:seed (optional)\n// npx prisma db seed\n\n// ----- Admin & RBAC (NFR: Security, PDPA) -----\nmodel AdminUser {\n  id           String     @id @default(uuid())\n  email        String     @unique\n  passwordHash String\n  name         String?\n  roleId       String\n  role         Role       @relation(fields: [roleId], references: [id])\n  active       Boolean    @default(true)\n  createdAt    DateTime   @default(now())\n  updatedAt    DateTime   @updatedAt\n  auditLogs    AuditLog[]\n}\n\nmodel Role {\n  id          String      @id @default(uuid())\n  name        String      @unique // e.g. SUPER_ADMIN, ADMIN, OPERATOR, VIEWER\n  permissions String      @default(\"[]\") // JSON array of permission codes\n  adminUsers  AdminUser[]\n}\n\n// ----- Member Level (Yellow, Silver, Black) - BQuik-style benefits -----\nmodel MemberLevel {\n  id              String   @id @default(uuid())\n  code            String   @unique // YELLOW | SILVER | BLACK\n  name            String // Yellow Card | Silver Card | Black Card\n  sortOrder       Int      @default(0)\n  privilegeDetail String? // Benefit details as newline-separated text\n  createdAt       DateTime @default(now())\n  updatedAt       DateTime @updatedAt\n  members         Member[]\n}\n\n// ----- Member & Identity (LINE, Web, Mobile - Single Member ID) -----\n// Profile: Name, Surname, NationalType, Citizen ID / Passport, Sex, Birthdate, Mobile, Email, Point balance, Address\n// Address: AddressNo, Building, Road, Soi, Subdistrict, District, Province, PostalCode\nmodel Member {\n  id               String             @id @default(uuid())\n  memberId         String             @unique // Single Member ID across channels\n  lineUserId       String?            @unique\n  memberLevelId    String?\n  memberLevel      MemberLevel?       @relation(fields: [memberLevelId], references: [id])\n  // Profile\n  name             String // Given name (required)\n  surname          String // (required)\n  nationalType     String // THAI | OTHER (required)\n  citizenId        String? // Thai Citizen ID (when nationalType = THAI)\n  passport         String? // Passport number (when nationalType = OTHER)\n  sex              String // M | F (required)\n  birthdate        DateTime // (required)\n  mobile           String // (required)\n  email            String?\n  displayName      String? // e.g. LINE display name\n  channel          String? // LINE | WEB | MOBILE\n  consentPDPA      Boolean            @default(false)\n  consentAt        DateTime?\n  active           Boolean            @default(true)\n  createdAt        DateTime           @default(now())\n  updatedAt        DateTime           @updatedAt\n  pointBalance     Int                @default(0)\n  // Address (addr_ prefix)\n  addr_addressNo   String?\n  addr_building    String?\n  addr_road        String?\n  addr_soi         String?\n  addr_subdistrict String?\n  addr_district    String?\n  addr_province    String?\n  addr_postalCode  String?\n  pointLedgers     PointLedger[]\n  redemptions      Redemption[]\n  transactions     PointTransaction[]\n}\n\n// ----- Point Engine (real-time, expiration) -----\nmodel PointLedger {\n  id          String    @id @default(uuid())\n  memberId    String\n  member      Member    @relation(fields: [memberId], references: [id])\n  balance     Int // snapshot after each tx\n  change      Int // +earn -redeem -expire -adjust\n  type        String // EARN | REDEEM | EXPIRE | ADJUST | CAMPAIGN\n  referenceId String? // campaignId, transactionId, etc.\n  expiresAt   DateTime?\n  createdAt   DateTime  @default(now())\n}\n\nmodel PointTransaction {\n  id          String   @id @default(uuid())\n  memberId    String\n  member      Member   @relation(fields: [memberId], references: [id])\n  amount      Int // positive = earn, negative = redeem\n  type        String // PURCHASE | REDEMPTION | CAMPAIGN | ADJUSTMENT\n  referenceId String?\n  branchId    String?\n  metadata    String? // JSON\n  createdAt   DateTime @default(now())\n}\n\n// ----- Reward & Privilege Catalog -----\nmodel Reward {\n  id          String       @id @default(uuid())\n  name        String\n  description String?\n  category    String // DISCOUNT | SERVICE | PRIVILEGE | PRODUCT\n  partnerId   String?\n  pointCost   Int\n  quantity    Int          @default(-1) // -1 = unlimited\n  validFrom   DateTime?\n  validTo     DateTime?\n  active      Boolean      @default(true)\n  createdAt   DateTime     @default(now())\n  updatedAt   DateTime     @updatedAt\n  redemptions Redemption[]\n}\n\nmodel Redemption {\n  id         String   @id @default(uuid())\n  memberId   String\n  member     Member   @relation(fields: [memberId], references: [id])\n  rewardId   String\n  reward     Reward   @relation(fields: [rewardId], references: [id])\n  pointsUsed Int\n  status     String   @default(\"COMPLETED\") // PENDING | COMPLETED | CANCELLED\n  branchId   String?\n  createdAt  DateTime @default(now())\n}\n\n// ----- Campaign & Promotion -----\nmodel Campaign {\n  id          String   @id @default(uuid())\n  name        String\n  type        String // DISCOUNT | CASHBACK | REDEMPTION\n  description String?\n  conditions  String? // JSON: time, segment, branch\n  config      String? // JSON: rules, banners\n  validFrom   DateTime\n  validTo     DateTime\n  active      Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n}\n\nmodel Banner {\n  id         String   @id @default(uuid())\n  campaignId String?\n  title      String\n  imageUrl   String?\n  linkUrl    String?\n  sortOrder  Int      @default(0)\n  active     Boolean  @default(true)\n  createdAt  DateTime @default(now())\n}\n\n// ----- Branch & Service -----\nmodel Branch {\n  id        String   @id @default(uuid())\n  code      String   @unique\n  name      String\n  address   String?\n  region    String?\n  active    Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// ----- Notification (LINE, broadcast) -----\nmodel NotificationLog {\n  id       String   @id @default(uuid())\n  memberId String?\n  channel  String // LINE | EMAIL | PUSH\n  type     String // POINTS | PROMO | BROADCAST\n  payload  String? // JSON\n  sentAt   DateTime @default(now())\n  status   String   @default(\"SENT\")\n}\n\n// ----- Audit (NFR: Compliance, RBAC) -----\nmodel AuditLog {\n  id         String     @id @default(uuid())\n  adminId    String?\n  adminUser  AdminUser? @relation(fields: [adminId], references: [id])\n  action     String // CREATE | UPDATE | DELETE | LOGIN | POINT_ADJUST\n  resource   String // MEMBER | REWARD | CAMPAIGN | POINTS\n  resourceId String?\n  details    String? // JSON\n  ip         String?\n  createdAt  DateTime   @default(now())\n}\n",
